class Solution:
    def sumOfPower(self, nums: List[int]) -> int:
        """internet solution:
        https://leetcode.com/problems/power-of-heroes/solutions/3520202/c-java-python3-5-lines-explained/?languageTags=python3
        """
        mod, pre, res = 10 ** 9 + 7, 0, 0
        for x in sorted(nums):
            res = (res + x * x * x + x * x * pre) % mod 
            pre = (pre * 2 + x) % mod
        return res

    def sumOfPower_s(self, nums: List[int]) -> int:
        """too slow"""
        nums.sort()

        resp = 0
        for ll in range(1, len(nums)+1):
            for start in range(len(nums)-ll+1):
                end = start+ll-1
                mi = nums[start]
                ma = nums[end]
                if ll >= 3:
                    mp = pow(2, ll-2, 1000000007)
                    resp = (resp + pow(ma, 2, 1000000007)*((mi*mp) % 1000000007)) % 1000000007
                else:
                    resp = (resp + pow(ma, 2, 1000000007)*mi) % 1000000007

        return resp


def do_test(i: int, s, r):
    c = Solution()
    resp = c.sumOfPower(s)
    if resp == r:
        print("OK", i)
    else:
        print("NOK", i, "expected", r, "response", resp)


